import React from "react";
import styled from "styled-components";

const Nav = styled.div`
  display: flex;
  flex-wrap: wrap;
  background: #433c4836;
  height: 50px;
  height: 100px;
  width: 100%;
`;

const Navbar = () => {
  return <Nav></Nav>;
};
export default Navbar;
